import { Component, OnInit } from '@angular/core';
import {ApiserviceService} from "../apiservice.service";
import {Router} from "@angular/router";



@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements OnInit {
  donationsArray : DonationObject [] = [];
  private src: string;
  itemToCart =0;

  private temp =new DonationObject();
  public reqItemObj:DonationObject[] =[];
  private obj = new DonationObject() ;
  overlay="none";
  msg="none";


  constructor(private api:ApiserviceService,private route:Router) { }

  ngOnInit() {
    this.api.getDonationDetails().subscribe(data=>{
      console.log(data);
      for (var item in data){
        console.log(data[item]);
        if (data.hasOwnProperty(item)) {
          var a =data[item].DishName.toLowerCase();

          if (a.search(/chicken/gi) != -1) {
            this.src = "https://cb58d6e34b427fd17a78-36413d03983f8a0e244911487df88bf9.ssl.cf1.rackcdn.com/meat-photographers-chicken-drumsticks-srirachi-44.jpg";
          } else if (a.search(/pork/gi) != -1 || a.search(/steak/gi) != -1) {
            this.src = "https://previews.123rf.com/images/golubovy/golubovy1604/golubovy160400017/55364801-grilled-pork-dish-with-fresh-vegetable-spices-food-photography-of-grilled-pork-medallions-with-herbs.jpg";
          } else if (a.search(/pizza/gi) != -1) {
            this.src = "https://previews.123rf.com/images/golubovystock/golubovystock1711/golubovystock171100490/90697747-food-photography-art-pizza-recipe-restaurant-menu-concept.jpg";
          } else if (a.search(/burger/gi) != -1) {
            this.src = "https://i0.wp.com/digital-photography-school.com/wp-content/uploads/2016/06/Rachel-Korinek-Food-Photographer-DPS-Hero-Angle-12.jpg?resize=750%2C501&ssl=1";
          } else if (a.search(/pancakes/gi) != -1) {
            this.src = "data:image/jpeg;base64,";
          } else if (a.search(/pasta/gi) != -1) {
            this.src = "data:image/jpeg;base64,";
          } else if (a.search(/veggies/gi) != -1) {
            this.src = "data:image/jpeg;base64,";
          } else {
            this.src = "https://cdn-ep19.pressidium.com/wp-content/uploads/2018/07/dark-food-photography-still-life.jpg";
          }

          let dish = data[item].DishName;
          this.obj.DishName = dish;
          this.obj.DOE = data[item].DOE;
          this.obj.url = this.src;
          this.obj.address= data[item].PickUpAddress;
          this.donationsArray.push(this.obj);

        }
      }

    });


  }

  hideMsg() {

    this.msg="none";
  }



  cart(xx:string,yy:any,zz:any,) {

    if(this.itemToCart < 1){

      this.itemToCart+=1;
      this.temp.DishName = zz;
      this.temp.DOE = yy;
      this.temp.address= xx;
      this.reqItemObj.push(this.temp);


    }else{

      this.msg="inline";
      setTimeout(this.hideMsg,100);
    }
  }


  cartView() {
    this.overlay="block";

  }

  removeitem(textContent: string, textContent2: string, textContent3: string) {

    this.reqItemObj.pop();

  }
}
export class DonationObject {
  get url(): string {
    return this._url;
  }

  set url(value: string) {
    this._url = value;
  }

  get DishName(): string {
    return this._DishName;
  }

  set DishName(value: string) {
    this._DishName = value;
  }

  get DOE(): Date {
    return this._DOE;
  }

  set DOE(value: Date) {
    this._DOE = value;
  }

  get address(): string {
    return this._address;
  }

  set address(value: string) {
    this._address = value;
  }

  private _url: string;
  private _DishName: string;
  private _DOE: Date;
  private _address: string;
}


